import React from 'react'

export const Toggle=({handleChange,isChecked})=> {
  return (
    <div npm i use-local-storage>
    <div className='toggle-container'>
        <input 
        type="checkbox"
        id="check"
        className="toggle"
        onChange={handleChange}
        checked={isChecked}
        />
     <label htmlFor="check">DarkMode</label>
    </div>
    </div>
  )
}
